INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (0, 0, 1, 11, 1, 100511, "これでバッチリッス！\nどうッスか？\nトラタイガーみたいにかっこよく\n描けてるんじゃないッスかね？", 10, 28412, 28412022, 0.5);
