INSERT INTO `v1_f4d4eae2ea621933fa0bcd42e27299aca956b5e72c79c9ec464148f4c591ac21` VALUES (0, 0, 1, 11, 1, 103711, "ふふっ、そうだね。\n君の憧れてるヒーローみたいに\nちゃんと描けてるよ。\n……一時はどうなるかと思ったけど。", 10, 28412, 28412027, 0.5);
